	@override String get transcoding_preset_preset => 'Voreinstellung (-preset)';
	@override String get transcoding_preset_preset_description => 'Komprimierungsgeschwindigkeit. Eine langsamere Voreinstellungen erzeugt kleinere Dateien und erhöht die Qualität, wenn man eine gewisse Bitrate anstrebt. VP9 ignoriert Geschwindigkeiten über „Schneller“.';
	@override String get transcoding_reference_frames => 'Referenz-Frames';
	@override String get transcoding_reference_frames_description => 'Die Anzahl der Bilder, auf die bei der Komprimierung eines bestimmten Bildes Bezug genommen wird. Höhere Werte verbessern die Komprimierungseffizienz, verlangsamen aber die Kodierung. 0 setzt diesen Wert automatisch.';
