			case 'week': return 'Woche';
			case 'welcome': return 'Willkommen';
			case 'welcome_to_immich': return 'Willkommen bei Immich';
			case 'year': return 'Jahr';
			case 'years_ago': return 'Vor {years, plural, one {einem Jahr} other {# Jahren}}';
			case 'yes': return 'Ja';
			case 'you_dont_have_any_shared_links': return 'Du hast keine geteilten Links';
			case 'zoom_image': return 'Bild vergrößern';
			default: return null;
		}
	}
}

